import images from "../../assets";

interface BannerItem {
  image: {
    source: string;
    overlayLabel?: string;
    borderRadius?: string | number;
  };
  title: string;
  description?: string | ((...args: any[]) => string);
  button: string;
}

export const bannerItems: BannerItem[] = [
  {
    image: {
      source: images.rentBanner,
    },
    title: "Rent a property",
    description: "Come look at rent",
    button: "Click to rent",
  },
  {
    image: {
      source: images.buyBanner,
    },
    title: "buy a property",
    description: "Come look at buy",
    button: "Click to buy",
  },
];
